import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const Hello = (props) => {
  return (
    <div>
<p>
        Hello {props.name}, you are {props.age} years old
      </p>
          </div>
  )
}

const App = () => {
  return (
    <div>
      <h1>Greetings</h1>
      <Hello name="George" />
      <Hello name="Daisy" />
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
